sys_variable_value.value:
(function execute(inputs, outputs) {
    var alephAlphaUtils = new AlephAlphaUtils();
    inputs = alephAlphaUtils.trimInputs(inputs);
    var mandatoryInputs = [{
        "input_label": "Model",
        "value": inputs.model,
        "type": "string"
    }, {
        "input_label": "Prompt",
        "value": inputs.prompt,
        "type": "string"
    }, {
        "input_label": "Maximum Tokens",
        "value": inputs.maximum_tokens,
        "type": "integer"
    }];
    alephAlphaUtils.validateMandatoryInputs(mandatoryInputs);
    inputs = alephAlphaUtils.validateAndParseInputs(inputs);
    outputs.nice = inputs.nice;
    delete inputs['nice'];
    outputs.request_body = JSON.stringify(inputs);
    
})(inputs, outputs);

