sys_variable_value.value:
(function execute(inputs, outputs) {
	if (inputs.status == '200') {
        var response = JSON.parse(inputs.responseBody);
        outputs.model_version = response.model_version;
        outputs.completions = response.completions;
        outputs.optimized_prompt = response.optimized_prompt;
      	outputs.action_status_code = "0";
        outputs.action_status_message = "Success";
    } else {
      	outputs.action_status_code = inputs.status;
        outputs.action_status_message = new AlephAlphaUtils().getErrorMessage(inputs.status, inputs.responseBody);
    }
})(inputs, outputs);

